import React, { useState } from 'react';
import axios from 'axios';

const SignUpPage = () => {
  const [name, setName] = useState('');
  const [number, setNumber] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [speciality, setSpeciality] = useState('');
  const [gender, setGender] = useState('');
  const [country, setCountry] = useState('');
  const [userType, setUserType] = useState('');

  const handleNameChange = (event) => {
    setName(event.target.value);
  };

  const handleNumberChange = (event) => {
    setNumber(event.target.value);
  };

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleSpecialityChange = (event) => {
    setSpeciality(event.target.value);
  };

  const handleGenderChange = (event) => {
    setGender(event.target.value);
  };

  const handleCountryChange = (event) => {
    setCountry(event.target.value);
  };

  const handleUserTypeChange = (event) => {
    setUserType(event.target.value);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    // Create a user object with the form data
    const newUser = {
      name,
      number,
      email,
      password,
      speciality,
      gender,
      country,
      userType,
    };

    try {
      // Make a POST request to store the user information
      await axios.post('users.j', newUser);

      // Clear the form fields
      setName('');
      setNumber('');
      setEmail('');
      setPassword('');
      setSpeciality('');
      setGender('');
      setCountry('');
      setUserType('');

      // Redirect or show a success message as needed
    } catch (error) {
      console.error('Error storing user information:', error);
      // Handle error, e.g., show an error message
    }
  };

  return (
    <div className="assign">
      <u><h1 className='header'>Create New Account</h1></u>
      <form onSubmit={handleSubmit}>
        <br></br>
        <div className="sign-body">
        </div>
        <label>
          <input className='Input' type="text" placeholder='Enter your name' value={name} onChange={handleNameChange} />
        </label>
        <br />
        <label>
          <input className='Input' type="email" placeholder='Enter your e-mail' value={email} onChange={handleEmailChange} />
        </label>
        <br />
        <label>
          <input className='Input' type="text" placeholder='Enter your phone number' value={number} onChange={handleNumberChange} />
        </label>
        <br />
        <label>
          <input className='Input' type="password" placeholder='Enter your password' value={password} onChange={handlePasswordChange} />
        </label>
        <br />
        <label>
          <input className='Input' type="text" placeholder='Enter your speciality' value={speciality} onChange={handleSpecialityChange} />
        </label>
        <br />
        <input className='checkB' type='checkbox' id='male' value='Male' onChange={handleGenderChange} />
        <label className='select-text' >Male&emsp;&emsp;</label>
        <input className='checkB' type='checkbox' id='female' value='Female' onChange={handleGenderChange} />
        <label className='select-text' >Female</label>
        <br />
        <label className='select-text'> Select country:</label>
        <select className='select-box' name="countries" id="country" value={country} onChange={handleCountryChange}>
          <option value="" disabled>Select Country</option>
          <option value="Egypt">Egypt</option>
          <option value="Palestine">Palestine</option>
        </select>
        <br />
        <label className='select-text'> Sign As:</label>
        <select className='select-box' name="character" id="userType" value={userType} onChange={handleUserTypeChange}>
          <option value="" disabled>Select User Type</option>
          <option value="Doctor">Doctor</option>
          <option value="Patient">Patient</option>
        </select>
        <br />
        <button className='Sign-button' type="submit">Sign Up</button>
      </form>
    </div>
  );
};

export default SignUpPage;
